// Libs
import React from 'react';
import { BrowserRouter, Route, Switch } from 'react-router-dom';

// Components
import HumanitarianMap from './components/HumanitarianMap';

const Routes = () => (
	<BrowserRouter>
		<Switch>
			<Route exact path='/' component={HumanitarianMap} />
		</Switch>
	</BrowserRouter>
);

export default Routes;
